import Offcanvas from "react-bootstrap/Offcanvas";

import Logo from "../utilities/image/Logo.svg";

import {IoCloseSharp} from 'react-icons/i'

export default function BurgerMenu({ show, handleClose }) {
  return (
    <>
      <Offcanvas show={show} onHide={handleClose}>

        <Offcanvas.Title className="text-center" onClick={handleClose}>
          <img class="imageSpinNav" src={Logo}></img>
        </Offcanvas.Title>
        <Offcanvas.Body>
          Some text as placeholder. In real life you can have the elements you
          have chosen. Like, text, images, lists, etc.
        </Offcanvas.Body>
      </Offcanvas>
    </>
  );
}
